import React from 'react'
import styled from 'styled-components';
import { IoHeartOutline } from "react-icons/io5";

const MovieTalkCardWrap = styled.div`
    width: 500px;
`

function MovieTalkCard({ review }) {


    return (
        <MovieTalkCardWrap>
            <img src={review.iamge} style={{ width: '200px' }} />
            <div>
                <div>작성자 : {review.name}</div>
                <div>{review.rating}</div>
                <div>{review.text}</div>
                <IoHeartOutline />
                <button>팔로우</button>
            </div>
        </MovieTalkCardWrap>
    )
};

export default MovieTalkCard;
